const Ubuntu300 = `@font-face { font-family: 'Ubuntu'; font-style: normal; font-weight: 300; src: local('Ubuntu Light'), local('Ubuntu-Light'), url('data:font/woff2;base64,') format('woff2'); }`;
const Ubuntu300italic = `@font-face { font-family: 'Ubuntu'; font-style: italic; font-weight: 300; src: local('Ubuntu Light Italic'), local('Ubuntu-LightItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const UbuntuRegular = `@font-face { font-family: 'Ubuntu'; font-style: normal; font-weight: 400; src: local('Ubuntu Regular'), local('Ubuntu-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const UbuntuItalic = `@font-face { font-family: 'Ubuntu'; font-style: italic; font-weight: 400; src: local('Ubuntu Italic'), local('Ubuntu-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
